#include <gtest/gtest.h>

#include "00918_maximum_sum_circular_subarray.h"

class SolutionTest : public ::testing::Test
{
public:
    Solution sol;
};

TEST_F(SolutionTest, Example1)
{
    vector<int> para{1,-2,3,-2};
    EXPECT_EQ(3, sol.maxSubarraySumCircular(para));
}

TEST_F(SolutionTest, Example2)
{
    vector<int> para{5,-3,5};
    EXPECT_EQ(10, sol.maxSubarraySumCircular(para));
}

TEST_F(SolutionTest, Example3)
{
    vector<int> para{3,-1,2,-1};
    EXPECT_EQ(4, sol.maxSubarraySumCircular(para));
}

TEST_F(SolutionTest, Example4)
{
    vector<int> para{3,-2,2,-3};
    EXPECT_EQ(3, sol.maxSubarraySumCircular(para));
}

TEST_F(SolutionTest, Example5)
{
    vector<int> para{-2,-3,-1};
    EXPECT_EQ(-1, sol.maxSubarraySumCircular(para));
}

TEST_F(SolutionTest, WrongAnswer1)
{
    vector<int> para{-5,3,5};
    EXPECT_EQ(8, sol.maxSubarraySumCircular(para));
}

